import "./App.css";
import Radio from "./Radio";

function App() {
  function handleClick() {
    alert("clicked");
  }

  return (
    <div className="App">
      <h1>Rock Paper Sissors</h1>
      <Radio list={["rock", "paper", "sissors"]} sendVal={handleClick} />
    </div>
  );
}

export default App;
